(823, 'John smyl', 'JOHN SMYL’ est un prometteur jeune dj guadeloupéen rempli de talent et débordant d’énergie. Il fait partie d’une des relèves les plus significatives de la Guadeloupe avec ses tubes tout plein de chaleur ( BOUYON QUEEN , PLI O , OU VLE FLEX , DIRTY GYAL , etc...) et nous ramenant parfois à la réalité de la vie. De plus en plus présent dans le milieu Reggae dance hall, Jump up, bouyon JOHN SMYL’ nous invite à embarquer avec lui et à nous laisser aller à kiffer ses tubes à plus de 2000 à l’heure…. yiiiiwwww !!! Né aux Abymes (Guadeloupe) le 13 Mai 1988 Il vit à pliane Gosier avec ses parents, ses trois frères et sa soeur dont il est le cadet, Il commence à écrire ses premiers textes et à faire ses premières scènes avec l’aide de son frère (Dj AKEL) et se fait connaitre petit à petit dans sa commune. Il fonde un groupe d’artistes en 2001 composé de plusieurs jeunes artistes du même crew : PLIANA PARADIZ et sort son premier tube et clip « 2000 a LE ». Il reste absent quelques années, sans mettre de coté ses projets artistiques, le temps de poursuivre ses études et de se mettre en poche son diplôme d’électrotechnicien. De fil en aiguille, il progresse et fait de nombreuses rencontres intéressantes puis réalise et participe à divers projet (RECTA MIX PROD, le KARTEL, ……). En 2009, il fait la rencontre de sélecta j2MO dj officiel du WU TANG PARK de grand camp qui L’invite à participer sur la compile « KONETT LA RI 3 » dont il fait la promo, avec le titre « LE ROI DU SOCA » durant divers prestations : podium du tour, fête communale, concert : GWADA OVER GROUND TOUR, spectacle : GWADA DANCE HALL QUENN…..ou encore émission télé « BATTLE » (concoctée et présentée par D.DALY).', '2015-06-22 21:38:00', 'john-smyl', '176576142418117', 'johnsmyl'),
