(966, 'Bridjahting', 'De son vrai nom Caffa Christopher, Bridjahting est né à Sarcelles.\r\n\r\nLe rappeur originaire de Guadeloupe, a grandi à Boulogne-Billancourt et ré-\r\n\r\nside actuellement à Bagneux (92). \r\n\r\nBridjahting commence la musique avec son groupe Los Shitos dans lequel \r\n\r\non retrouve Well.P... mais l’expérience ne fût pas fructueuse. \r\n\r\nDésormais en solo, Bridjahting dévoile dès 2014 le titre Piraterie, qui mar-\r\nque un retour fracassant tout d’abord sur le web. \r\n\r\nC''est en en avril 2015 que le grand public va mieux le découvrir. Bridjahting \r\n\r\nest mis en lumière sur l''album D.U.C de Booba avec le titre Mové lang sur \r\n\r\nlequel un autre grand talent du rap , Gato Da Bato se fait aussi davantage \r\n\r\nremarquer. On peut alors dire que Bridjahting frappe un grand coup en ap-\r\nportant une énergie qui lui est propre et en s’imposant avec ce fameux \r\n\r\ngimmick « Mové lang », repris à tue-tête par toutes les générations. \r\n\r\nDevenu un vrai hit « banger», Mové lang cumule déjà presque 5 millions de \r\n\r\nvues sur Youtube, de nombreux remixes sur internet ont été réalisés. Mové \r\n\r\nLang est joué dans les clubs du monde entier et même repris comme hymne \r\n\r\ndes vainqueurs dans des évènements sportifs internationaux comme au \r\n\r\nQuai 54. \r\n\r\nAussi cette fin d''année s''annonce chargée pour Bridjahting avec la prépara-\r\ntion de son 1er projet Glory dont le 1er extrait Equipe ultime et l''intro sont \r\n\r\ndéjà en ligne sur Youtube.', '2015-10-26 22:46:00', 'bridjahting', 'Losshitos', 'bridjahting92'),
