(1047, 'Bosh milli', 'BOSHMILLI est un collectif qui est originaire de la Guyane, plus précisément de saint -Laurent du Maroni. Il a d''abord été connu sous le nom de KUT-ONE puis, en 2009 une fois arrivé en France hexagonale, il change de nom pour faire allusion à leur origine bushinengué « BOSHMILLI » qui est un oxymore : "Bosh" est l''appellation à connotations négatives que l''on utilisait pour parler du peuple bushinengué, suivie de Milli diminutif de millionnaire qui fait surtout allusion à la richesse culturelle de ce peuple.\r\nPlusieurs projets sont mis en place par le collectif autour de la musique et la promotion de la culture guyanaise dans sa globalité. Ils enchaînent les singles avec des artistes de l''ouest et du Suriname qui font sensation dans l''ouest Guyanais : No Gangsta feat Loba Lodiliki, Piisi feat Ray Neïman et Kut-one feat Maxxy dready....\r\nEn 2013, ils mettent en place le BOSHMILLI FESTIVAL, un festival annuel qui se veut promoteur de la musique afro-caribbean et également des artistes qui évoluent dans la structure BOSHMILLI Entertainment.\r\n\r\nArtistes : Lol digne, Gvybz, Gjona, Faboo G, kikis, show, Loba Lodilikie.', '2016-01-21 07:19:00', 'bosh-milli', '556431597751711', NULL),
(1048, 'Milonika', 'Milonika est une artiste d’origine Capverdienne née le 5 janvier 1987 à Nice.\r\nElle est aujourd’hui une artiste montante de la scène Kizomba où elle réussi à se démarquer grâce à son style unique.\r\nL’écriture est indispensable à son épanouissement, elle l’utilise pour retranscrire et partager ses émotions. Une sensibilité émouvante ressort de ses chansons souvent mélancoliques.', '2016-01-21 07:28:00', 'milonika', 'milonikamusic', NULL),
