(1121, 'SevenFaya', 'SevenFaya est un artiste caribéen français d’origine martiniquaise au service de la musique depuis plus de quinze ans. Fort de ses nombreuses expériences scéniques et plébicité pour son originalité énergique, il s’associe avec le Skamélia Band pour offrir au public une expérience musicale unique et personnelle. Baigné dans la culture musicale caribéenne depuis son plus jeune âge, c’est sur un magnétophone-cassette que Sevenfaya enregistre ses premières « tunes » improvisées au beatbox vocaux déjantés.\r\nArtiste prolifique, Sevenfaya est un « showman », prêt à donner le maximum pour partager sa passion de la musique. Il évolue dans le dancehall, Reggae, Soul & Zouk.\r\nIl se produit aussi bien lors d’évènements importants de la scène francophone que de la scène underground depuis sept ans.\r\nRiche de ses rencontres et connexions, l’artiste se consacre désormais à la réalisation de productions matures et engagées qui définissent son univers musical aux influences internationales. Fervent militant du créole, il mélange les styles et ose des combinaisons improbables.\r\nLe métissage musical fait partie intégrante de son concept créatif.', '2016-03-07 00:16:00', 'sevenfaya', 'sevenfaya', 'sevenfaya'),
