(1745, 'Même si', 'J7f5l3etSVM', '2015-10-17 23:10:00', 1, 'meme-si', 'Jessye Belleval', '----------------\r\nPAROLES\r\n---------------\r\nJ’entends encore tes pas qui s’éloignent de moi\r\nJe sais que rien ne va\r\nMais je n’veux pas y croire\r\nJe n’ai rien vu venir, mais vas-­tu revenir\r\nJ’avoue je pense qu’a toi\r\nEn nous je voudrais croire\r\nPourquoi es tu parti, j’n’ai pas encore compris\r\nNon tu n’reviendras pas\r\nJe dois pourtant le croire\r\n\r\nRefrain :\r\nMême si le chagrin m''envahi\r\nJe saurai t’éloigner\r\nDe mon coeur et de ma vie\r\nMême si tu as partagé mes nuits\r\nJe saurais t''oublier\r\nEt tes mots d''amour aussi\r\n\r\nJe vois qu’au fond de toi\r\nTu n’as que faire de moi\r\nMême si je pleure je crie\r\nRien ne te ramen’ra à moi\r\nEt quand je pense parfois\r\nA ce qu’on à déjà\r\nJe me dis que ma vie\r\nN’ sera jamais mieux sans toi\r\n\r\n(Refrain)\r\n\r\nJ’y croyais tellement fort\r\nMais je sais j''ai eu tord\r\n\r\nDe t’avoir tout donné,\r\nMême plus qu’il en fallait\r\nJ’ai voulu croire encore\r\nA l’amour au trésor\r\nJe n’ai jamais pensé\r\nQu’un jour tu partirais\r\n\r\n(Refrain)\r\n\r\nOuh ouh ouh, je dois laisser passer l’amour qui m’est donné\r\nOuh ouh ah ahhhhh\r\n\r\n(Refrain)\r\n\r\n-------------------------------\r\nRESEAUX SOCIAUX\r\n------------------------------\r\nTWITTER : @jessyebelleval\r\nINSTAGRAM : jessye_belleval\r\nSITE WEB : www.jessyebelleval.com\r\nCONTACT : 0690848925\r\njbellevalcontact@gmail.com\r\n\r\n-------------------------------\r\nTÉLÉCHARGEMENT LÉGAL\r\n------------------------------\r\niTunes : https://itunes.apple.com/fr/album/partir-en-live/id874896617\r\nGoogle Play : https://play.google.com/store/music/album/Jessye_Belleval_Partir_en_live?id=Bbv7vvvchvayhosfnswrvlfcy3a&hl=fr\r\n\r\n\r\n---------------\r\nCRÉDITS\r\n---------------\r\nTitre : Même si. \r\nAuteur : Jessye BELLEVAL \r\nCompositeurs :Jim RAMA | Patrick ANDREY\r\nCordes : Patrick ANDREY\r\nGuitares : Thierry DELANNAY\r\nChœurs 