(1775, 'You', 'fE0kB1ab8PE', '2015-10-30 17:31:00', 1, 'you', 'Antonny Drew', 'Clip Officiel  | Antonny Drew - You  |  1er extrait de l''album  "Experience", deuxième opus d''Antonny Drew.\r\nTéléchargez "You" ici :\r\niTunes : https://itunes.apple.com/fr/album/you-single/id1045069595\r\nGoogle Play : https://play.google.com/store/music/album/Antonny_Drew_You?id=Bob25xo5xlyu7uodv46z54autii\r\nQobuz : http://www.qobuz.com/fr-fr/album/you-antonny-drew/3700735807437\r\n\r\nApple Music : https://itun.es/fr/B8Ns-\r\nDeezer : http://www.deezer.com/album/11318314\r\nSpotify : https://open.spotify.com/album/1k8QTeYfPfn2adWrXriTVc\r\nNapster : http://app.napster.com/artist/antonny-drew/album/you\r\nFnac Jukebox : http://www.fnacjukebox.com/fr/album/you-1132388\r\n\r\n\r\nCrédits :\r\n\r\nAuteur : Antonny Drew \r\nCompositeur : Antonny Drew \r\nInstrumentale : Staniski \r\nSound Engineer : Mickael Johan \r\nProduction : Serenite Events\r\n\r\nParoles : \r\n\r\nÇa a mis du temps mais maintenant que je t''ai trouvée, je me sens pousser des ailes je suis prêt à braver tout les dangers.\r\nC''est mon coeur que t''entends, ma tête et mon coeur l''ont guidé, je voudrais toucher des lèvres ta fleur tu sais te faire frissonner.\r\nJ''suis pas le mec qui tchat qui bluff que tu kiffes mais ne fait pas ton bonheur. Señorita je te donne mon coeur, Bella Donna près de toi je suis bien\r\n\r\nRefrain\r\nI love love love love you\r\nI need need need need you (X4)\r\n\r\nTout ne sera pas tout blanc car nous devrons faire face aux problèmes\r\nNou ké fè nou konfyans non péké ni méfyans ayen péké two bèl baw manzèl Lè mwen vwè-w mwen trapé mal tèt\r\nSèl biten mwen té vlé sé ke vou é mwen nou té pé kyèk\r\nLè ou vwè sa fèt tèk an té ja sav ou té ké mété bayé\r\nWanna touch you gyal, doo lè mwen vwè-w sé kon si tini chalè\r\n\r\nRefrain\r\nI love love love love you\r\nI need need need need you (X4)\r\n\r\nMon amour, pour toujours c''est avec toi que je veux être, oh chabine, kafrine je te suivrais jusqu''au bout\r\nElle est ata faya pas shatta mais quand elle aime elle devient comme ça\r\nVini mwen fè-w vwè l''Himalaya, vini mwen fè-w fly\r\n\r\nRefrain\r\nI love love love love you\r\nI need need need need you (X8)', NULL, 'SereniteEvents', 0),
