(1803, 'Mwen enmé-w', 'l2fE2KZnvcU', '2015-11-11 23:15:00', 1, 'mwen-enme-w', 'Lycinais Jean', 'Nouveau titre de lycinais jean.\r\n\r\nDate de sortie : 10 novembre 2015\r\n\r\nTitre : Mwen enmé-w\r\nArtiste : Lycinaïs Jean\r\nA/C : Lycinaïs Jean\r\nProd/ Arr : Lycinaïs Jean\r\nMix/Mastering : DreamTracks\r\nRéalisation : Jima Kanor (NiceShoot)\r\nFigurants : Thia BrownSugar & Love D\r\nAssistants : Meggy T. & Rikko\r\nManagment: Audrey Mitsy\r\n\r\nParoles :\r\n\r\nMwen enmé''w\r\nmenm si''w pa bondyé pou wè''y\r\nmenm si''an pa bondyé pou''w kwè mwen\r\nmenm si té ni dé kon vou sé vou mwen téé chwazi\r\nmwen enmé''w\r\nli adan dé zyé an mwen\r\nmèt men a''w si tjè an mwen\r\npran tousa''y vé ba''w bébé\r\nsé vou kè li chwazi\r\n\r\nApré tousa tan\r\nan pa ka konprann\r\nkoman, an ki jan\r\nou ka fè rèmèt mwen an kèstyon\r\napré tousa tan\r\nkè mwen rété ka atann kè''w pran tan\r\nwouvin èvè dényé ban mwen on chans\r\npou nou woupran chimen lanmou ansanm\r\noui kon vou menm\r\nmwen ja goumé èvè santiman\r\nmwen éséyé pran on dôt chimen\r\ndè chéri on dôt men an ni''w an san an mwen\r\nni''w an lanm an mwen baby\r\nsèl moun an ka pran o sèryé sé vou\r\nsenkè d’maten prèmyé solèy sé vou\r\nan vé pa''w douté dè sa ki tan nou\r\ndèpi dé lanné doudou\r\n\r\nPa lésé twôp imajinasyon égaré nou\r\npa lésé démon a kochma rantré an rèv an nou\r\nsiouplé pa lésé yo kontrolé vi an nou Baby\r\na dé kè nou ka fè lanmou\r\nan viv lavi é mwen aprann\r\né jodi jou an pé konprann\r\nsa’y té fè motè la pran pann\r\nsi ou vlé byen tann s''an ni a di''w tann lanmen a’w\r\n\r\nVybz: Kè li chwazi, chwazi a vi, kè li chwazi...\r\n\r\n\r\nTRADUCTION:\r\n\r\nJe t’aime\r\nmême si tu n’es pas Dieu pour le voir\r\nque je ne suis pas Dieu pour que tu me crois…\r\nmême s’il en existait deux comme toi\r\nc’est toi que je choisirais…\r\nje t’aime\r\nlis le dans mes yeux, mets ta main contre mon coeur\r\nreçois ce qu’il te donne, il t’a choisie\r\n\r\nAprès tout ce temps, je ne comprends pas\r\ncomment peux-tu me remettre en question\r\naprès tout ce temps où j’ai attendu ton retour\r\nque tu daignes me donner une nouvelle chance\r\nafin que l’on reprenne le chemin de l’amour\r\n\r\nComme toi, j’ai refoulé mes sentiments\r\nj’ai essayé de prendre une autre direction\r\nde chérir quelqu’un d’autre\r\nmais je t’ai dans les veines et je t’ai dans l’âme bébé\r\ntu es la seule que je prenne au sérieux\r\ntu es le premier rayon de soleil au matin\r\nne doutes pas de ce qui nous lie depuis tant de temps\r\n\r\nne laisse pas les idées noires nous envahir\r\nne laisse pas les démons s’introduire dans nos rêves\r\nS’il te plaît ne les laisse pas contrôler notre vie,\r\ncar l’amour se fait à deux…\r\nJ’ai vécu ma vie et j’ai appris, aujourd’hui je peux comprendre\r\nce qui a pu poser problème, si tu veux bien m’écouter tends ta main…\r\n\r\nC’est toi qu’il a choisi, pour la vie… il t’a choisie!', NULL, 'JimaKanor', 1),
