(1856, 'Caribbean', '89MiYOI0uHo', '2015-12-03 21:11:00', 1, 'caribbean', 'Don''s Music', 'Tony Chasseur Feat E.sy Kennenga Maurane Voyer & Swe - Caribbean \r\n\r\nExtrait du coffret double album INÉDIT de Tony Chasseur ‪Lakou Lanmou‬ disponibe sur itunes   https://itunes.apple.com/fr/album/lakou-lanmou/id1053486859\r\nUne réalisation pharaonique qui marque les 30 années de carrière de l''artiste. \r\nOn y retrouve du Mizikopéyi, TwAn, GilTony’K, du zouk, du Kompa, de la chanson créole, du Créole Jazz… \r\nSes amis y sont toujours présents et actifs, Thierry Vaton, Gilles Voyer, Thierry Fanfant, Paco Man’Alma, Chris Combette… Rejoints par Ronald Tulle, Alain Jean-Marie, Michel Alibo, Grégory Privat, Roland Brival, Véronique Hermann Sambin, Wesley Semé, E.sy Kennenga… \r\nUn pupitre de cordes, des cuivres, une chorale Gospel !!! \r\nTout cela fait que ce projet est le plus abouti de toute sa carrière, un coffret qui fera date !!! \r\nTony - "Lakou Lanmou", un coffret, deux Cds, Zouk et Pop dans "Lakou Bò Kay", Créole Jazz dans "Lakou Wouvè". \r\n"Lakou Lanmou", il y a du nouveau sous le soleil de la Caraïbe…’', NULL, NULL, 0),
