n an la pou tout’ plézi charnel Ou pé kryé mwen a tout’ lè\r\nÉ si an kouch aw ou an galè\r\nSa ké finn hardkô ou an doussè\r\nSi ou tou sèl\r\n\r\nRefrain\r\n\r\nCouplet 4 :\r\n(Sco)\r\nEncore un con qui n''est pas de taille\r\nCaractère enflammé sur ces hommes qui lui ont fait perdre son time\r\nTrop d'' boloss qui n'' respectait pas\r\nElle veut du Love et de l''affection, son coeur à trop d''entaille\r\nAvec un mec elle est sans complexe\r\nElle ne cherche pas l''amour parfait mais elle aime quand son homme\r\nparle sexe \r\nSans mention et sans prétexte \r\nSexy t''as besoin d''un vrai gars qui te traite comme une princesse\r\n\r\nRefrain', NULL, 'Djdaboyz', 0),
