(2022, 'Tagada', 'Acc43iSeKn0', '2016-01-29 21:47:00', 1, 'tagada', 'Chabine Prod Urban Channel', 'Titre extrait de la "FAKE MIXTAPE" D''ELJI.\r\n\r\nAuteurs: SORROW et ELJI\r\nCompositeur: DJ LIZZI\r\nRéalisation: Wanakaera Prod\r\nMaquillage :Céline\r\nProduction: Chabine Prod\r\nEditions: De Nada Publishing\r\n\r\nRemerciements :  IPCC, Restaurant BLACK PEARL, Zouk TV, Albert FILA, HAZOU, DJ SKUNK, tous les figurants.\r\n\r\nLien iTunes : https://itunes.apple.com/fr/album/tagada-feat.-sorrow-single/id1069896519\r\n\r\nTAGADA\r\n\r\nMan wè an fanm a 4 pat anlè an iPhone 6\r\nYo di mwen aparaman ke sété fanm Francis\r\nGen missié la ka pren pié''y manzel dot fow adan la suce\r\nYo di mwen ke dèyè sa ti manzel la ni Bac plus\r\nManzel la ka joué la Sainte-Nitouche\r\nCe joli petit bébé a du caca dans la couche\r\nKa fè rol ni maladi pou trapé bouche à bouche\r\n(hahaha) Elji j''etouffe\r\n\r\nRefrain\r\n\r\nSa vieu, égri\r\nMénage à trois, mariage, cérémonie \r\nMoun ka fè la java, Prêt'' ka fai loméli \r\nMi en lot'' soucoué têt'', en lot'' dorémi\r\n\r\nCouplet\r\nTagada tagada 1er tagada pa tagada\r\nmoun ka fè le buzz enlè le Net tagada\r\nDonnez moi du thé avec 2 tagada\r\n\r\nAurélie sé en fi a maman ka joué lé Gaza \r\nY pa ka kouté poutan manman''y mété''y en Gard a\r\nY inmin Francis paske Francis fai yonn dé gardav \r\nAurélie zavè tchou''y ou two bava \r\nEn tann di ke ti yèyèz inmin tola\r\nEn tann di ke yo ka hum hum ba en dola\r\nVidéo dè fanm tou tou ni épi dé gro la \r\nAtcheleman si têt'' zot, moun ka fai la hola\r\n\r\nSa vieu, égri\r\nMénage à trois, mariage, cérémonie \r\nMoun ka fè la java, Prêt'' ka fai loméli \r\nMi en lot'' soucoué têt'', en lot'' dorémi\r\n\r\nCouplet\r\nTagada tagada 1er tagada pa tagada\r\nmoun ka fè le buzz enlè le Net tagada\r\nDonnez moi du thé avec 2 tagada\r\n\r\nAn selfie scé an foto ke ou ka fè tou sèl\r\nAn batt douss sé an koké ke ou ka fè tou sèl\r\nFanm ka fè la pucelle\r\nPortable digicel\r\nAssumé pa kraké ou 