(2042, 'Bleu nuit', 'JUq6jCkRO5E', '2016-02-04 22:56:00', 1, 'bleu-nuit', 'NJIEalbum', 'NJIE : Bleu Nuit version 2016 / Réalisation Ronald RUBINEL   -   Composition de Gilles FLORO \r\n"Quand les claviers de Gilles FLORO et de Ronald RUBINEL se croisent..."  FACEBOOK : NJIE http://www.facebook.com/NJIE.fan.page\r\nRemerciements : AIR CARAIBES, AEROPORT GUADELOUPE POLE CARAIBES, TILTT Boutique, Salon Alice Elysée Coiffure (Paris 20è), Accent'' Aiguille by Véronique Bertome, Misha, Ti Kenny.\r\nPrises de vue : Ronald RUBINEL\r\nRéalisation, montage & étalonnage du Clip : Ronald RUBINEL\r\nDrone : Jima KANOR\r\nMixage : DJ JACKSON, Yvan CHARPENTIER et Ronald RUBINEL au Studio JACKSOUND RECORD\r\n\r\nCONTACT BOOKING : njiealbum@orange.fr\r\n\r\n\r\nBLEU NUIT\r\n\r\nAC : Gilles FLORO   /  Interprète : NJIE\r\n\r\nNa na na na na, na na na …\r\n\r\nChak fwa mwen anvi ékri\r\nAsi sab lanmou\r\nOn vag lanmè ka éfasé kon gro jalou\r\nMwen ka pèd on dirèksyon\r\nKon nyaj ki pa ni zèl\r\nMi sé pou sa manzèl sirèn rété tou sèl\r\n\r\nNa na na na na…\r\n\r\nO swè si la maré ban mwen on ti chans\r\nMwen ké pé sav priyé plenn lin\r\nFé mwen konfyans\r\nMwen ké tapisé tout rivaj\r\nÉpi dé " mots d''amour "\r\nSé pou mwen pé sa èspéré\r\nDé vwé-w on jou\r\n\r\nNa na na na na…\r\n\r\nKoulé an zyé an mwen, koulé\r\nLespri ka dérivé o lwen\r\nMwen ja atann vou lontan lontan\r\nMwen ka révé ou toujou la\r\nAn fas an mwen\r\n\r\nKoulé an zyé an mwen , koulé ho non non non\r\nLespri ka dérivé o lwen\r\nMwen ja atann vou lontan lontan\r\nMwen ka révé ou toujou la\r\nAn bra an mwen\r\n \r\nNa na na na na…\r\n\r\nMwen ja pèd on dirèksyon kon nyaj ki pa ni zèl\r\nMi sé pou sa manzèl sirèn rété tou sèl\r\nTou sèl, tou sèl, tou sèl, tou sèl tou sèl\r\n\r\nNa na na na na…', NULL, NULL, 0),
