(2105, 'Vwè Mizè Pa Mò', 'PSyfhAn9Vvk', '2016-02-22 22:42:00', 1, 'vwe-mize-pa-mo', 'Riddla yasala', 'Auteur : Riddla ( Boulogne Wesley )\r\nCompo : Francky Filiole\r\nRéa : Riddla & Radix Corporation\r\nedition : Yasala.corp\r\n\r\nVMPM\r\n\r\nVwè mizè pa mò mèm si sa té pé ay myé\r\nÉ si bondyé dakò, yeah\r\n\r\nCouplet 1 :\r\nSé’y ki pli gran jénéral\r\nSa gidé’w lè kè a’w vin’ avèg’\r\nLè douvan a’w tini brouya\r\nFò’w gravi dé montàn’ a galè\r\nLè’w ka mandé’w ka’w fè dè mal\r\nPoukwa asi’w syel la vé tonbé\r\nAdan mond’a’w ni tròp niaj\r\nKitan ou ké rivwè solèy\r\n\r\nPré-refrain :\r\nAn moman féblès’, féblès’\r\nI ké ba’w sa ki fo\r\nLè’w santi détrès’\r\nKé ba’w fòs é rékonfò\r\nJanmè i ké délès’, délésé’w\r\nI enmé’w klè, nwè, rich ou pov\r\nAnd when He say Yes\r\nNobody can’t say No\r\n\r\nRefrain :\r\nVwè mizè pa mò, mèm si sa té pé ay myé\r\nÉ si Bondyé dakò, pou mwen sa ké alé\r\nVwè mizè pa mò, mèm si sa té pé ay myé\r\nÉ si Bondyé dakò, pou mwen sa ké\r\n\r\nCouplet 2 :\r\nOu ka kriyé’y yenki lè’w bizwen on pal\r\nApa ayen i pé rèfizé’w\r\nÉ ou la ka atann si on mirak’\r\nMè ou mèm ès ou vé édé’w\r\nLè i pa ni pon moun a lantouraj\r\nToujou ni on zorèy ki ké kouté’w\r\nÉ ou manti si’w di kè sé an non a’y kè’w ka tchouyé\r\n\r\nPré-refrain :\r\nDan lé moman féblès’, féblès’\r\nI ké ba’w sa ki fo’w\r\nSé’y ki Love and Happiness\r\nKé ba’w jwa é rékonfò\r\nJanmè i ké délès’, délésé’w\r\nEnmé’y pa on défo\r\nAnd when He say Yes\r\nNobody can’t say No  Oh Yeah\r\nPont :\r\nLè ou ka kwè adan on pli gran fòs\r\nTout’ moun ka pran’w pou on alyèn’\r\nMé sé li ki toujou fidèl o post’\r\nÉ ban mwen sé li ki méyè alyé\r\nToujou ké ni on plas’ endétronabl’\r\nSé my Best Friend, sé’y, sé’y, yeah\r\n\r\nRefrain :\r\nVwè mizè pa mò, mèm si sa té pé ay myé\r\nÉ si Bondyé dakò, pou mwen sa ké alé\r\nVwè mizè pa mò, mèm si sa té pé ay myé\r\nÉ si Bondyé dakò, pou mwen sa ké \r\nAlé\r\nKé ba’w jwa é rékonfò\r\nAlé\r\nKé ba’w fòs é rékonfò\r\nAlé, alé, alé\r\nSé’y ki Love and Happiness', NULL, 'RadixCorp;Mister_Francky', 1),
