(2163, 'ZonZon', 'wQTVAgH_n1k', '2016-03-08 22:57:00', 1, 'zonzon', 'Don''s Music', 'Download: http://v.blnk.fr/A1d5jdP7h\r\n\r\nAbonnez-vous à la chaine: http://bit.ly/donsmusicofficial\r\n\r\nEn tournée Concert \r\n#TropiquesAtrium #Martinique le 10 mars \r\nRéservez votre place : http://bit.ly/20i7YRp\r\n#RoyalRiviera #Guadeloupe le 12 mars \r\nRéservez votre place :  http://bit.ly/1PIf7aN\r\nConcert au #Cabaretsauvage #Paris le 23 Avril\r\nRéservez votre place : http://bit.ly/1PIf7aN\r\nCe nouvel opus retrace les événements, situations, drames et aussi, les joies qui ont traversés la  vie de l''artiste, et celle de ses compatriotes en Guadeloupe ces 7 dernières années.\r\nCet album marque, musicalement, un « retour » au pays. L’opus précédent « Lèspri Kaskòd », évoquait une envie d’aller explorer d’autres horizons. Là, tout en gardant l’esprit « Kako Mizik », cette nouvelle création est résolument et volontairement plus populaire et accessible.\r\nLes influences des musiques guadeloupéennes: Zouk, Gwo-Ka, St Jean, et caribéennes Reggae notamment, côtoient celles du groove Créole Pop de certaines chansons.', NULL, NULL, 0),
