(2285, 'Ganja Have To Burn', 'Go3DfHgGXWw', '2016-04-14 07:15:00', 1, 'ganja-have-to-burn', 'One Time Rec Odds', 'Nouveau single de l’album « Justice » d’ILEMENTS qui sortira février 2016, co-produit par Earthquake Family Production & RKF Production.\r\nTourné à Saint Martin aux Antilles par WellDone, le clip vous fera voyager à travers un magnifiques jardin de son île !\r\nà écouter sans modération !\r\nBon voyage !\r\nNew single from the album "Justice" by ILEMENTS, co-produced by Earthquake Family Production & RKF Production.\r\nDirected by WellDone in St. Martin in the northeast of the Caribbean, landscapes of the island !\r\nEnjoy it and have a good flight !', NULL, NULL, 0),
